    false,nt"url": null,nt"notes": "This annual narrative report for Audubon
    National Wildlife Refuge (including Lake Nettie National Wildlife Refuge, Camp Lake
    Easement Refuge, Cottonwood Lake Easement Refuge, Wintering River Easement Refuge,
    Sheyenne Lake Easement Refuge, and Lake Otis Easement Refuge) outlines Refuge accomplishments
    during the 1970 calendar year. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, raptors, fish, and reptiles- is also covered. The Refuge
    development and maintenance section discusses physical developments, plantings,
    collections and receipts, vegetation control, and prescribed burning. Resource management
    is outlined; topics include grazing and fur harvesting. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety. Items of interest, N-R forms, and photographs are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
